import React from 'react';
import { Table } from 'react-bootstrap';

export default class MyCards extends React.Component {
  render() {
    return (
      <Table responsive>
        <thead>
          <tr>
            <th>#</th>
            {Array.from({ length: 120 }).map((_, index) => (
              <th key={index}>Table heading</th>
            ))}
          </tr>
        </thead>
      </Table>
    );
  }
}
